$(document).ready(function(){
  $('.turn').click(function(){
    var id = $(this).data("id");
    $.ajax({
        type: 'PUT',
        url: "/equipment/"+id,
        data: {active: true},
        success: function(repsonse) {
            console.log(repsonse);
        },
        error: function(repsonse) {
        }
    })

  })
});
